import React from 'react'
import Logo from "./LogoTwins.png";


export const Header = () => {
  return (
    <>
    <div>Header</div>
    <div>
      <img src={Logo} className='logo' alt="logo" width="10vh" />
    </div>
    </>
  )
}
export default Header;
